import React, { Fragment } from "react"

class Navbar extends React.Component {
    constructor(props){
        super(props)
        this.state = {}
    }


    render(){
        return (
<Fragment>
    <header>
        <div className="logo"><img src="https://i.ibb.co/M16Zywy/Get-Over-it.png" /> </div>
        <nav>
           <ul>
               <li>Buy</li>
               <li>Sell</li>
               <li>Tell</li>
           </ul>
        </nav>
        <button class="signin-btn">Sign In</button>
    </header>
    </Fragment>
        )
    }
}

export default Navbar
